CREATE DEFINER=`root`@`localhost` PROCEDURE `Sp_FilterPurchaseInvoiceByUserId`(
    IN UserId VARCHAR(255)
)
BEGIN
    SELECT Tbl_User.UserId, Tbl_User.UserName, Tbl_User.PhoneNumber, Tbl_User.UserRole,
           Tbl_Purchase_Invoice.InvoiceNo, Tbl_Purchase_Invoice.TotalAmount, 
           Tbl_Purchase_Invoice.CreatedDate, Tbl_Purchase_Invoice.PaymentMethod
    FROM Tbl_User
    INNER JOIN Tbl_Purchase_Invoice ON Tbl_User.UserId = Tbl_Purchase_Invoice.UserId
    WHERE Tbl_Purchase_Invoice.UserId = UserId
      AND Tbl_User.IsDeleted = 0
      AND Tbl_User.UserRole = 'Customer'
      ORDER BY Tbl_Purchase_Invoice.InvoiceNo DESC;
END ;;
DELIMITER ;
