CREATE DEFINER=`root`@`localhost` PROCEDURE `Sp_GetGiftCardDetailsByInvoiceAndStatus`(
    IN InvoiceNo VARCHAR(255),
    IN Status VARCHAR(50)
)
BEGIN
    SELECT PID.Id, PID.GiftCardId, PID.Quantity, PID.SubTotal, PID.TypeOfBuying,
           PID.RecipientName, PID.RecipientPhoneNumber,
           GC.GiftCardNo, GC.Title, GC.Description, GC.ExpiryDate, GC.Amount, GC.Status, GC.QRCode,
           GC.GiftCardDuration, GC.CashbackPercentage
    FROM Tbl_Purchase_Invoice_Detail PID
    INNER JOIN Tbl_GiftCard GC ON GC.GiftCardId = PID.GiftCardId
    WHERE PID.InvoiceNo = InvoiceNo
      AND GC.Status = Status;
END ;;
